import React from 'react';
import Navbar from './Navbar';
import '../pagecss/Home.css';
import homeph from '../photos/photoph.png';
import Produits from './Produits';
import photo from '../photos/photosp.jpeg';

function Home() {
  // Tableau d'objets contenant les informations de chaque produit


  return (
    <div>
      <Navbar />

      <img src={homeph} alt="" className="home_photo" />
      <p className='home_categ'  style={{fontSize:'1.5em'}}>  Sport  </p>

      <div className="produits">
      {/* Boucle sur le tableau d'objets produits et génère les composants Produits */}
      {produits.map((produit, index) => (
        <div key={index} >
          <Produits info={produit} />
        </div>
      ))}  </div>
    </div>
  );
}

export default Home;
